irection Settings'=>'Omdirigerings indstillinger.','Mode'=>'Tilstand','The Simple mode only logs URI and access time, while the Advanced mode creates detailed logs including additional information such as the Referer URL.'=>'Den Simple tilstand logger kun URI og adgangstid, mens avanceret tilstand opretter detaljerede logfiler, herunder yderligere oplysninger som referencen URL.','Sets the max number of rows in a log. Set to 0 to disable the limit.'=>'Indstiller til maksimale antal rækker i en log. Indstil til 0 for at deaktivere begrænsning.','Turn ON to ignore all query parameters (the part after a question mark in a URL) when logging 404 errors.'=>'Aktivere for at ignorere alle forespørgselsparametre (delen efter et spørgsmålstegn i en URL), når der logges 404 fejl.','Search engines may prominently display your contact phone number for mobile users.'=>'Søgemaskiner viser muligvis dit kontaktnummer for mobilbrugere.','Format used when the address is displayed using the <code>[rank_math_contact_info]</code> shortcode.<br><strong>Available Tags: {address}, {locality}, {region}, {postalcode}, {country}, {gps}</strong>'=>'Format bruges, når adressen vises ved hjælp af <code> [rank_math_contact_info]</code> shortcode.<br><strong>Tilgængelige Tags:{address}, {locality}, {region}, {postalcode}, {country}, {gps}</strong>','Select opening hours. You can add multiple sets if you have different opening or closing hours on some days or if you have a mid-day break. Times are specified using 24:00 time.'=>'Vælg åbningstider. Du kan tilføje flere sæt, hvis du har forskellige åbnings- eller lukketider på nogle dage, eller hvis du har en pause midt på dagen. Tidspunkterne er angivet som 24:00 timer.','An API Key is required to display embedded Google Maps on your site. Get it here: %s'=>'En API Key er påkrævet for at vise integrerede Google Maps på dit websted. Få den her: %s','%d redirection(s) successfully deleted.'=>'%d omdirigering(er) slettet med succes.','<strong>Delete</str