til administratorer. Besøgende på websted bliver omdirigeret uden forsinkelse.','<strong>Delete</strong> permanently removes the redirection.'=>'<strong>Slet</strong> fjerner omdirigeringen permanent.','301 redirections are <em>permanent</em>. The old URL will be removed in search engines and replaced by the new one, passing on SearchRank and other SEO scores. Browsers may also store the new URL in cache and redirect to it even after the redirection is deleted from the list here.'=>'301-omdirigeringer er <em>permanente</em>. Den gamle URL vil blive fjernet i søgemaskinerne og erstattet af den nye, hvilket giver SearchRank og andre SEO-scores videre. Browsere kan også gemme den nye URL i cache og omdirigere til den, selv efter omdirigeringen er slettet fra listen her.','Using a 302 <em>temporary</em> redirection is useful when you want to test a new page for client feedback temporarily without affecting the SEO scores of the original page.'=>'Brugen af en 302 <em>midlertidig</em> omdirigering er nyttig, når du vil teste en ny side for klientfeedback midlertidigt uden at påvirke SEO-resultaterne på den originale side.','Redirections can be exported to your .htaccess file for faster redirections, in SEO > Settings > Import/Export.'=>'Omdirigeringer kan eksporteres til din .htaccess-fil for hurtigere omdirigeringer, i SEO > Indstillinger > Importer/Eksporter.','Extend the functionality of WordPress by creating redirects in our plugin when you change the slug of a post, page, category or a CPT. You can modify the redirection further according to your needs.'=>'Udvid funktionaliteten af WordPress ved at oprette omdirigeringer i vores plugin, når du ændrer slug på et indlæg, en side, kategori eller en CPT. Du kan modificere omdirigeringen yderligere i overensstemmelse med dine behov.','Your theme may display the Site Tagline, and it can also be used in SEO titles &amp; descriptions. Set it to something unique. You can change it by navigating to <a href="%s">Settings &gt; General</a>.'=>'Dit tema viser muligvis webstedets tagline, og det kan også bruges i SEO-titler &amp; beskrivelser. Indstil det til noget unikt. Du kan ændre det ved at gå til <a href="%s">Indstillinger &gt; Generelt</a>.','Most WordPress themes place your site\'s tagline in a prominent position (inside header tags near the top of the page).  Using the right tagline can give your site an SEO boost.'=>'De fleste WordPress-temaer placerer dit websteds tagline i en fremtrædende position (inde i header-tags nær toppen af siden). Brug af det rigtige slogan kan give dit websted et SEO-boost.','Unfortunately, the standard WordPress tagline is "Just Another WordPress site."  That\'s pretty sloppy looking, and it does nothing for your SEO.  In fact, it\'s actually a security risk - it makes it easy for hackers with a WordPress exploit to locate your site with an automated search.'=>'Desværre er standard WordPress tagline "Just Another WordPress site." Det ser ret sjusket ud, og det gør intet for din SEO. Dette udgør faktisk en sikkerhedsrisiko – det gør det nemt for hackere med en WordPress exploit, at lokalisere dit websted med en automatisk søgning.','Permalink Structure'=>'Permanentlink struktur','Google Search Console has been linked.'=>'Google Search Console er blevet tilknyttet.','You have not linked Google Search Console yet.'=>'Du har ikke tilknyttet Google Search Console endnu.','There are %s with no focus keyword set.'=>'Der er %s uden fokus nøgleord indstillet.','Focus keywords appear in the titles of published posts where it is set.'=>'Fokusnøgleord vises i titlerne på offentliggjorte indlæg, hvor det er indstillet.','+%d More...'=>'+%d mere...','Your site has one or more sitemaps.'=>'Dit websted har et eller flere sitemaps.','No sitemaps found.'=>'Ingen sitemaps fundet.','Selected page: %s'=>'Valgt side: %s','Change URL'=>'Skift URL','Start Page Analysis'=>'Start side analyse','Analysing Page&hellip;'=>'Analyserer side&hellip;','Analysing Website&hellip;'=>'Analyserer websted&hellip;','Complete'=>'Fuldført','This tab contains General settings related to the XML sitemaps.'=>'Denne fane indeholder generelle indstillinger relateret til XML-sitemaps.','Set the sitemap options for author archive pages. %s.'=>'Indstil sitemap-indstillingerne for forfatterens arkivsider. %s.','attachments'=>'Vedhæftninger','your product pages'=>'dine produktsider','single %s'=>'enkelt %s','Sitemap URL: %s'=>'Sitemap-URL: %s','Please note that this will add the attachment page URLs to the sitemap, not direct image URLs.'=>'Bemærk venligst, at dette vil tilføje de vedhæftede side-URL\'er til sitemap\'et, ikke direkte billed-URL\'er.','your product %s pages'=>'dine produkt %s sider','%s archives'=>'%s arkiver','Taxonomies:'=>'Taksonomier:','XML Sitemap %1$s %2$s'=>'XML Sitemap %1$s %2$s','Exclude User Roles'=>'Ekskluder brugerroller','Start Date'=>'Start datoen','Response Code'=>'Svar kode','Items'=>'Emner','Changing your tagline is very easy.  Just head on over to <a target="_blank" href="%1$s">Settings - General</a> in WordPress\'s admin menu (on the left), or click on the link in this sentence.'=>'Det er meget nemt at ændre din undertitel . Bare gå over til <a target="_blank" href="%1$s">Indstillinger - Generelt</a> i WordPresss admin-menu (til venstre), eller klik på linket i denne sætning.','For the best SEO results, use a custom permalink structure, preferably one that includes the post title (<code>%%postname%%</code>). You can change it by navigating to <a href="%s">Settings &gt; Permalinks</a>'=>'For at få de bedste SEO-resultater skal du bruge en tilpasset permalinkstruktur, helst en, der inkluderer indlægstitlen (<code>%%postname%%</code>). Du kan ændre det ved at gå til <a href="%s">Indstillinger &gt; Permalinks</a>','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'Standard-permalink-strukturen er ret grim - WordPress genererer knap så lækre-URL\'er som: http://www.yoursite.com/?p=99','It\'s not very kind on the eyes, and it does nothing for your site\'s SEO.  In fact, it can hurt it - Google\'s bot is quite cautious about crawling pages that look auto-generated.'=>'Det er ikke særlig venligt for øjnene, og det gør intet for dit websteds SEO. Faktisk kan det skade det – Googles bot er ret forsigtig med at crawle sider, der ser autogenererede ud.','Fortunately, it\'s very easy to fix.  Just hop on over to <a target="_blank" href="%1$s">Settings - Permalinks</a>.  Then chose the "Post Name" option.'=>'Heldigvis er det meget nemt at rette. Bare hop over til <a target="_blank" href="%1$s">Indstillinger - Permalinks</a>. Vælg derefter indstillingen "Indlægsnavn".','Of course, if you don\'t give Rank Math a focus keyword to work with, it can\'t give you any useful feedback.'=>'Selvfølgelig, hvis du ikke giver Rank Math et fokusnøgleord at arbejde med, så kan det selvfølgelig ikke give dig nogen brugbar eedback.','Post Titles Missing Focus Keywords'=>'Indlægstitler mangler fokusnøgleord','Fixing this issue is easy - just edit the post, and set a Focus Keyword.  Then follow Rank Math\'s analysis to improve your rankings.'=>'Det er nemt at løse dette problem - bare rediger indlægget, og indstil et fokusnøgleord. Følg derefter Rank Maths analysen for at forbedre dine placeringer.','Rank Math uses these focus keywords to analyze your on-page content.  It can tell if you\'ve done a good job of optimizing your text to rank for these keywords.'=>'Rank Math bruger disse fokusnøgleord til at analysere dit indhold på siden. Dette kan fortælle, om du har gjort et godt stykke arbejde, med at optimere din tekst til at rangere for disse fokusnøgleord.','Rank Math allows you to set a focus keyword for every post and page you write - the option is in the "Meta Box", which appears under the text editor in the screen where you write and edit content.'=>'Rank Math giver dig mulighed for at indstille et fokusnøgleord for hvert indlæg og hver side du skriver - muligheden er i "Meta Box", som vises under teksteditoren på skærmen, hvor du skriver og redigerer indhold.','Setting focus keywords for your posts allows Rank Math to analyse the content.'=>'Indstilling af fokusnøgleord til dine indlæg, gør det muligt for Rank Math at analysere indholdet.','HTML Page Titles play a large role in Google\'s ranking algorithm.  When you add a Focus Keyword to a post or page, Rank Math will check to see that you used the keyword in the title.  If it finds any posts or pages that are missing the keyword in the title, it will tell you here.'=>'HTML-sidetitler spiller en stor rolle i Googles rangeringsalgoritme. Når du tilføjer et fokusnøgleord til et indlæg eller en side, vil Rank Math kontrollere, at du har brugt nøgleordet i titlen. Hvis den finder nogle indlæg eller sider, der mangler nøgleordet i titlen, vil den fortælle dig det her.','Register at Google Search Console and verificate your site by adding the code to <a href="%1$s">Settings &gt; Verificate Tools</a>, then navigate to <a href="%2$s">Settings &gt; Search Console</a> to authenticate and link your site.'=>'Registrer dig på Google Search Console, og bekræft dit websted ved at tilføje koden til <a href="%1$s">Indstillinger &gt; Bekræft værktøjer</a>, og naviger derefter til <a href="%2$s">Indstillinger &gt; Search Console</a> for at godkende og linke dit websted','Google\'s Search Console is a vital source of information concerning your rankings and click-through rates.  Rank Math can import this data, so you don\'t have to log into your Google account to get the data you need.'=>'Googles Search Console er en vigtig kilde til information om dine placeringer og klikrater. Rank Math kan importere disse data, så du ikke behøver at logge ind på din Google-konto for at få de data, du har brug for.','You can integrate the Google Search Console with Rank math in the <a href="%1$s" target="_blank">Search Console tab</a>. of Rank Math\'s General Settings menu.'=>'Du kan integrere Google Search Console med Rank math under<a href="%1$s" target="_blank">Search Console-fanen</a>. i Rank Maths menuen, med generelle indstillinger.','Read <a href="%1$s" target="_blank">this article</a> for detailed instructions on setting up your Google Webmaster account and getting Rank Math to work with the Google Search Console.'=>'Læs <a href="%1$s" target="_blank">denne artikel</a> for at få detaljerede instruktioner om, hvordan du opsætter din Google Webmaster-konto og får Rank Math til at fungere med Google Search Console.','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'XML-sitemaps er en speciel type tekstfil, der fortæller søgemaskinerne om strukturen på dit websted. Det er en liste over alle de ressourcer (sider og filer), du gerne vil have søgemaskinen til at indeksere. Du kan tildele forskellige prioriteter, så visse sider vil blive crawlet først. Før XML-sitemaps, var søgemaskiner begrænset til at indeksere det indhold, de kunne finde ved at følge de forskellige links. Det er stadig en vigtig funktion for søgemaskine crawler, men XML-sitemaps har gjort det nemmere for indholdsskaberne og søgemaskiner at samarbejde.','If you don\'t have an XML sitemap, the best option is to install a plugin that creates sitemaps for you. That way you\'ll know the sitemap will always be up-to-date. Plugins can also automatically ping the search engines when the XML file is updated. The Rank Math WordPress plugin gives you complete control over your site\'s XML sitemaps. You can control the settings for each page as you write or edit it, and Rank Math will ping Google as soon as you submit your edits. This results in fast crawls and indexing.'=>'Hvis du ikke har et XML-sitemap, er den bedste mulighed, at installere et plugin, der opretter en sitemaps til dig. På den måde ved du, at sitemap altid vil være opdateret. Plugins kan også automatisk pinge søgemaskinerne, når XML-filen opdateres. Rank Math WordPress-plugin\'et giver dig fuld kontrol over dit websteds XML-sitemaps. Du kan styre indstillingerne for hver side, mens du skriver eller redigerer den, og Rank Math vil pinge Google, så snart du indsender dine redigeringer. Dette resulterer i hurtige gennemgange og indeksering.','Your Site Tagline is set to the default value <em>Just another WordPress site</em>.'=>'Dit websteds beskrivelse er indstillet til standardværdien <em>Endnu et WordPress-websted</em>.','Your Site Tagline is set to a custom value.'=>'Dit webstedsnavn er indstillet til en brugerdefineret værdi.','Permalinks are set to the default value. <em>Pretty permalinks</em> are disabled. '=>'Permalinks er indstillet til standardværdien. <em>Smukke permalinks</em> er deaktiveret.','Permalinks are set to a custom structure but the post titles do not appear in the permalinks.'=>'Permalinks er indstillet til en brugerdefineret struktur, men indlægstitlerne vises ikke i permalinksene.','Post permalink structure is set to %s.'=>'Indlægs permalink strukturen er sat til %s.','There are %s published posts where the primary focus keyword does not appear in the post title.'=>'Der er %s publicerede indlæg, hvor fokusnøgleordet ikke vises i indlæggets titel.','Rank Math has detected new post types: %1$s. You may want to check the settings of the <a href="%2$s">Titles &amp; Meta page</a> and <a href="%3$s">the Sitemap</a>.'=>'Rank Math har fundet nye indlægstyper: %1$s. Du vil måske kontrollere indstillingerne for <a href="%2$s">Titler &amp; Metaside</a> og <a href="%3$s">sitemappen</a>.','Exclude Users'=>'Ekskluder brugere','Links Per Sitemap'=>'Links pr. sitemap','Max number of links on each sitemap page.'=>'Maks. antal links på hver sitemap side.','Images in Sitemaps'=>'Billeder i sitemaps','Add user IDs, separated by commas, to exclude them from the sitemap.'=>'Tilføj bruger-id\'er adskilt af kommaer, for at ekskludere dem fra sitemap.','Include reference to images from the post content in sitemaps. This helps search engines index the important images on your pages.'=>'Inkluder reference til billeder fra indlæggets indhold i sitemaps. Dette hjælper søgemaskiner med at indeksere de vigtige billeder på dine sider.','Include Featured Images'=>'Medtag fremhævede billeder','Include the Featured Image too, even if it does not appear directly in the post content.'=>'Inkluder også det fremhævede billede, selvom det ikke vises direkte i indlæggets indhold.','Exclude Posts'=>'Ekskluder indlæg','Enter post IDs of posts you want to exclude from the sitemap, separated by commas. This option **applies** to all posts types including posts, pages, and custom post types.'=>'Indtast indlægs-id\'er for indlæg, du vil ekskludere fra sitemap\'et, adskilt af kommaer. Denne mulighed **gælder** for alle indlægstyper inklusive indlæg, sider og tilpassede indlægstyper.','Exclude Terms'=>'Ekskluder vilkår','Include in Sitemap'=>'Inkluder i sitemap','Include this post type in the XML sitemap.'=>'Inkluder denne indholdstype i XML-sitemap\'et.','Image Custom Fields'=>'Brugerdefinerede billed felter','Insert custom field (post meta) names which contain image URLs to include them in the sitemaps. Add one per line.'=>'Indsæt brugerdefinerede felt (post meta), som indeholder billed-URL\'er, for at inkludere dem i sitemaps. Tilføj en pr. linje.','Include archive pages for terms of this taxonomy in the XML sitemap.'=>'Inkluder arkivsider for vilkår for denne klassificering i XML-sitemap.','Include Empty Terms'=>'Inkluder tomme vilkår','Include archive pages of terms that have no posts associated.'=>'Inkluder arkivsider med termer, som ikke har noget indhold tilknyttet.','Product\'s price.'=>'Produkt pris.','Product\'s price of the current product'=>'Produkt prisen på det aktuelle produkt','Product\'s SKU.'=>'Produkt varenummer','Product\'s SKU of the current product'=>'Produkt varenummeret på det aktuelle produkt','Product\'s short description.'=>'Produktets korte beskrivelse.','Product\'s short description of the current product'=>'Produktets korte beskrivelse af nuværende produkt','Product\'s brand.'=>'Produktets mærke.','Product\'s brand of the current product'=>'Produktets mærke for nuværende produkt','Remove base'=>'Fjern base','Remove category base'=>'Fjern kategoribase','Remove prefix from category URL.'=>'Fjern præfiks fra kategoriens URL.','default: /product-category/accessories/action-figures/ - changed: /accessories/action-figures/'=>'Standard: /product-category/accessories/action-figures/ - ændret: /accessories/action-figures/',' Remove parent slugs'=>'Fjern overordnede korttitel','Remove parent slugs from category URL.'=>'Fjern overordnede korttitel fra kategori URL.','Remove Generator Tag'=>'Fjern generator Tag','Remove WooCommerce generator tag from the source code.'=>'Fjern WooCommerce generator Tag fra source code.','Enable breadcrumbs function'=>'Aktiver brødkrumme funktionen','Turning off breadcrumbs will hide breadcrumbs inserted in template files too.'=>'Deaktivering af brødkrummer, skjuler også brødkrummer, der er indsat i skabelonfiler.','Separator character or string that appears between breadcrumb items.'=>'Skilletegn eller strenge, der vises mellem brødkrumme-elementer.','Show Homepage Link'=>'Vis hjemmeside-link','Display homepage breadcrumb in trail.'=>'Vis startsiden brødkrumme i sporet.','Homepage label'=>'Hjemmeside label','Label used for homepage link (first item) in breadcrumbs.'=>'SoftLabel bruges til hjemmesidelink (første element) i brødkrummer.','Prefix Breadcrumb'=>'Præfiks Brødkrumme','Prefix for the breadcrumb path.'=>'Præfiks for brødkrummestien.','Archive Format'=>'Arkivformat','Format the label used for archive pages.'=>'Formatér etiketten, der bruges til arkivsider.','Search Results Format'=>'Søgeresultats format','Format the label used for search results pages.'=>'Formatér etiketten, der bruges til søgeresultatsider.','404 label'=>'404 etiket','Label used for 404 error item in breadcrumbs.'=>'Etiket brugt til 404 fejlemne i brødkrummer.','Hide Post Title'=>'Skjul indlægstitel','Hide Post title from Breadcrumb.'=>'Skjul indlægstitel fra brødkrumme.','Show Category(s)'=>'Vis kategori(er)','If category is a child category, show all ancestor categories.'=>'Hvis kategori er en underkategori, vis alle overordnet kategorier.','Hide Taxonomy Name'=>'Skjul klassificeringsnavn','Hide Taxonomy Name from Breadcrumb.'=>'Skjul klassificeringsnavn for  brødkrumme.','.htaccess file not found.'=>'.htaccess fil ikke fundet.','.htaccess file is not writable.'=>'.htaccess filen er ikke skrivebar.','I understand the risks and I want to edit the file'=>'Jeg forstår risikoen, og jeg vil redigere filen','Add <code>alt</code> attributes for <code>images</code> without <code>alt</code> attributes automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Tilføj automatisk <code>alt</code>-egenskab til <code>billeder</code> uden <code>alt</code>-egenskab. egenskaben anvendes dynamisk, når indholdet vises, og det lagrede indhold ændres ikke.','Format used for the new <code>alt</code> attribute values.'=>'Format brugt til de nye <code>alt</code>-egenskabsværdier.','Add missing TITLE attributes'=>'Tilføj manglende TITLE egenskaber','Add <code>TITLE</code> attribute for all <code>images</code> without a <code>TITLE</code> attribute automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Tilføj automatisk <code>TITLE</code>-egenskab for alle <code>billeder</code> uden en <code>TITLE</code>-egenskab. egenskaberne anvendes dynamisk, når indholdet vises, og det lagrede indhold ændres ikke.','Be careful when editing the htaccess file, it is easy to make mistakes and break your site. If that happens, you can restore the file to its state <strong>before the last edit</strong> by replacing the htaccess file with the backup copy created by Rank Math in the same directory (<em>.htaccess_back_xxxxxx</em>) using an FTP client.'=>'Vær forsigtig, når du redigerer htaccess filen, det er nemt at lave fejl og ødelægge dit websted. Hvis det sker, kan du gendanne filen til dens tilstand <strong>før den sidste redigering</strong> ved at erstatte htaccess filen med sikkerhedskopien, oprettet af Rank Math i samme mappe (<em>.htaccess_back_xxxxxx</em> ) ved hjælp af en FTP-klient.','Title attribute format'=>'Title, egenskabs format','Alt attribute format'=>'Alt, egenskabs format','Format used for the new <code>title</code> attribute values.'=>'Format brugt til de nye <code>title</code>-egenskabsværdier.','Remove /category/ from category archive URLs. %s <br>E.g. <code>example.com/category/my-category/</code> becomes <code>example.com/my-category</code>'=>'Fjern /category/ fra kategoriarkivets URL\'er. %s <br>f.eks. <code>example.com/category/my-category/</code> bliver <code>example.com/my-category</code>','Why do this?'=>'Hvorfor gøre dette?','Redirection Manager'=>'Omdirigerings håndtering','Redirections Manager'=>'Omdirigerings håndtering','Please enable Redirections module.'=>'Aktiver venligst omdirigerings modulet.','Redirect Attachments'=>'Omdiriger vedhæftninger','Redirect all attachment page URLs to the post they appear in. For more advanced redirection control, use the built-in %s.'=>'Omdiriger alle vedhæftede side-URL\'er til det indlæg, de vises i. For mere avanceret omdirigeringskontrol, brug det indbyggede %s.','Redirect attachments without a parent post to this URL. Leave empty for no redirection.'=>'Omdiriger vedhæftede filer uden et overordnet indlæg til denne URL. Lad stå tomt for ingen omdirigering.','Nofollow Domains'=>'Nofollow Domæner','Only add <code>nofollow</code> attribute for the link if target domain is in this list. Add one per line. Leave empty to apply nofollow for <strong>ALL</strong> external domains.'=>'Tilføj kun <code>nofollow</code>-egenskab for linket, hvis destinations-domænet er på denne liste. Tilføj en pr. linje. Lad stå tomt for at anvende nofollow for <strong>ALLE</strong> eksterne domæner.','RSS Before Content'=>'RSS Før Indhold','Add content before each post in your site feeds.'=>'Tilføj indhold før hvert indlæg i dit websteds feeds.','RSS After Content'=>'RSS Efter indhold','Add content after each post in your site feeds.'=>'Tilføj indhold efter hvert indlæg i dit websteds feeds.','Contents are locked because a robots.txt file is present in the root folder.'=>'Indholdet er låst, fordi en robots.txt-fil er til stede i rodmappen.','Available variables'=>'Tilgængelige variabler','Variable'=>'Variabler','A link to the archive for the post author, with the authors name as anchor text.'=>'Et link til arkivet for indlægsforfatteren, med forfatterens navn som ankertekst.','A link to the post, with the title as anchor text.'=>'Et link til indlægget, med titlen som ankertekst.','A link to your site, with your site\'s name as anchor text.'=>'Et link til dit websted med dit websteds navn som ankertekst.','A link to your site, with your site\'s name and description as anchor text.'=>'Et link til dit websted med dit websteds navn og beskrivelse som ankertekst.','Featured image of the article.'=>'Fremhævede billede fra artiklen.','Google Search Console'=>'Google Search Console','Search Console Verification Page'=>'Search Console bekræftelsesside','Bing Webmaster Tools'=>'Bing Webmaster Tools','Enter your Bing Webmaster Tools verification HTML code or ID. Get it here: %s'=>'Indtast din HTML-kode eller id for bekræftelse af Bing Webmaster Tools. Hent det her: %s','Bing Webmaster Verification Page'=>'Bing Webmaster Verifikationsside','Automatically add <code>target="_blank"</code> attribute for external links appearing in your posts, pages, and other post types to make them open in a new browser tab or window. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Tilføj automatisk egenskaben <code>target="_blank"</code> til eksterne links, der vises i dine indlæg, sider og andre indlægstyper for at få dem til at åbne i en ny browserfane eller et nyt vindue. egenskaben anvendes dynamisk, når indholdet vises, og det lagrede indhold ændres ikke.','The <code>nofollow</code> attribute <strong>will not be added</strong> for the link if target domain is in this list. Add one per line.'=>'Egenskaben <code>nofollow</code> <strong>bliver ikke tilføjet</strong> til linket, hvis destinationsdomænet er på denne liste. Tilføj en pr. linje.','Nofollow Exclude Domains'=>'Nofollow udelukket domæner','Baidu Webmaster Tools'=>'Baidu webmasterværktøj','Yandex Verification ID'=>'Yandex Verifikations ID','Yandex.Webmaster Page'=>'Yandex.Webmaster Side','Pinterest Verification ID'=>'Pinterest verifikations ID','Pinterest Account'=>'Pinterest Konto','Norton Safe Web Verification ID'=>'Norton Safe Web verifikations ID','Norton Ownership Verification Page'=>'Norton Ejerskabsbekræftelsesside','Author Archives'=>'Forfatterarkiver','Disabled'=>'Deaktiveret','Enabled'=>'Aktiveret','Author Base'=>'Forfatterbase','Change the <code>/author/</code> part in author archive URLs.'=>'Skift <code>/author/</code>-delen i forfatterarkivets URL\'er.','Author Archive Title'=>'Forfatterens arkivtitel','Title tag on author archives. SEO options for specific authors can be set with the meta box available in the user profiles.'=>'Titeltag på forfatterarkiver. SEO-indstillinger for specifikke forfattere kan indstilles med metaboksen, der er tilgængelig i brugerprofilerne.','Author Archive Description'=>'Forfatterarkivets beskrivelse','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'Undertitel er den anden mulighed. Vælg en undertitel, der opsummerer dit websted med få ord. Undertitel er også et godt sted at bruge dit primære nøgleord.','Make sure the focus keywords you set for the posts appear in their titles.'=>'Sørg for, at de fokusnøgleord, du har angivet for indlæggene, vises i deres titler.','This looks nice for readers - and it gets your keywords into the URL (keywords in the URL is a ranking factor).'=>'Dette ser godt ud for læserne – og det får dine nøgleord ind i URL\'en (nøgleord i URL\'en er en rangeringsfaktor).','Fixing the issue is simple - just edit the post/page and add the focus keyword(s) to the title.'=>'Det er nemt at løse problemet - bare rediger indlægget/siden og tilføj fokus-nøgleordene til titlen.','Enter URIs or keywords you wish to prevent from getting logged by the 404 monitor.'=>'Angiv URI\'er eller nøgleordene, du ønsker at forhindre i at blive logget i 404 -visningen.','All published posts have focus keywords set.'=>'Alle udgivne indlæg har fokus-nøgleord sat.','Add SEO Controls for user profile pages. Access to the Meta Box can be fine tuned with code, using a special filter hook.'=>'Tilføj SEO-kontrol til brugerprofil sider. Adgang til meta box kan finjusteres, med kode ved hjælp af et speciel filter hook.','Default values for robots meta tag. These can be changed for individual posts, taxonomies, etc.'=>'Standardværdier for robot meta tag. Disse kan ændres for de individuelle indlæg, taksonomier mv.','You can use the separator character in titles by inserting <code>%separator%</code> or <code>%sep%</code> in the title fields.'=>'Du kan bruge separator-tegnet i titler ved at indsætte <code>%separator%</code> eller <code>%sep%</code> i titelfelterne.','Capitalize Titles'=>'Sæt titler med stort','OpenGraph Thumbnail'=>'OpenGraph miniaturebillede','Twitter Card Type'=>'Twitter korttype','Card type selected when creating a new post. This will also be applied for posts without a card type selected.'=>'Korttype valgt ved oprettelse af et nyt indlæg. Dette gælder også for indlæg uden valgt korttype.','Homepage Title'=>'Hjemmeside titel','Homepage title tag.'=>'Hjemmeside titel tag','Homepage meta description.'=>'Hjemmeside meta beskrivelse','Homepage Meta Description'=>'Hjemmeside meta beskrivelse','Homepage Robots Meta'=>'Hjemmeside robotter Meta','Select custom robots meta for homepage, such as <code>nofollow</code>, <code>noarchive</code>, etc. Otherwise the default meta will be used, as set in the Global Meta tab.'=>'Vælg brugerdefineret robot meta til hjemmesiden, såsom <code>nofollow</code>, <code>noarchive</code> osv. Ellers vil standard metaen som er angivet i global meta fanebladet, blive brugt, ','Custom'=>'Brugerdefineret','Title of your site when shared on Facebook, Twitter and other social networks.'=>'Titlen på dit websted, når det deles på Facebook, Twitter og andre sociale netværk.','Homepage Description for Facebook'=>'Hjemmeside beskrivelse for Facebook','Homepage Title for Facebook'=>'Hjemmeside titel for Facebook','Description of your site when shared on Facebook, Twitter and other social networks.'=>'Beskrivelse af dit websted, når det deles på Facebook, Twitter og andre sociale netværk.','Homepage Thumbnail for Facebook'=>'Hjemmeside miniaturebillede for Facebook','Image displayed when your homepage is shared on Facebook and other social networks. Use images that are at least 1200 x 630 pixels for the best display on high resolution devices.'=>'Billede, der vises, når din startside deles på Facebook og andre sociale netværk. Brug billeder, der er mindst 1200 x 630 pixels, for at få den bedste visning på enheder med høj opløsning.','Date Archives'=>'Dato arkiver','Date Archive Title'=>'Dato arkiv titel','Custom values for robots meta tag on homepage.'=>'Brugerdefinerede værdier for robot meta ta